import chess
import cProfile
import pstats

move_tables = {}

for piece_type in [chess.PAWN, chess.KNIGHT, chess.BISHOP, chess.ROOK, chess.QUEEN, chess.KING]:
    options = []
    for field in range(64):
        board = chess.Board("8/8/8/8/8/8/8/8")
        board.set_piece_at(field, chess.Piece(piece_type, color=True))
        moves = board.legal_moves
        target_fields = [x.to_square for x in moves]
        options.append(target_fields)
    move_tables[piece_type] = options

